Instruction.String:
while (Master.TaskResultQueue.Count > 0)
{
	TaskResult tr = Master.TaskResultQueue.Dequeue();
	if (!Master.TaskDictionary.ContainsKey(tr.TaskRef))
	{
	    Master.TaskDictionary.Add(tr.TaskRef,tr);
	}	
	int count = Master.TaskDictionary.Count;
	Master.TotalTaskCost += tr.cost;
	Master.AvgTaskCost = (double)Master.TotalTaskCost/(double)count;
	Master.TotalTaskQuality += tr.quality;
	Master.AvgTaskQuality = Master.TotalTaskQuality/(double)count;
	Master.TotalTaskDuration += tr.createdOn - tr.TaskRef.createdOn;		
	Master.AvgTaskDuration = Master.TotalTaskDuration/(double)count;
}

if (Model.Simulation.Simulator.Random < Master.CreateFrequency)
{
Task newTask = Master.CrowdSourcing.Create("Task") as Task;
newTask.Requestor = Master;
newTask.createdOn = Model.Simulation.Simulator.Scheduler.Time;
newTask.taskId = Master.TaskCounter+"@"+ Master.MasterId;
newTask.expTimeReq = Master.defaultExpTaskDuration + 	(Master.defaultExpTaskDurDeviation*Model.Simulation.Simulator.Random);

Master.TaskCounter++;
// Store task for later comparison to TaskResult - not needed as TaskResult refers to Task
// Master.TaskDictionary.Add(newTask, null);

newTask.Created();
}

while(AssignmentConnector.WaitingWorkerQueue.Count > 0 && AssignmentConnector.JobQueue.Count > 0)
{
	Worker worker = AssignmentConnector.WaitingWorkerQueue.Dequeue();
	Job job = AssignmentConnector.JobQueue.Dequeue();	
	job.Owner = worker;

	AssignmentConnector.JobQueueSize--;
	AssignmentConnector.WaitingWorkerQueueSize--;
	if (!AssignmentConnector.TaskResultDict.ContainsKey(job.TaskRef))
	{		
		AssignmentConnector.TaskResultDict.Add(job.TaskRef, new List<JobResult>());
	}
	job.Assign();
}

while (AssignmentConnector.TaskResultQueue.Count > 0)
{
	TaskResult tr = AssignmentConnector.TaskResultQueue.Dequeue();
	tr.createdOn = Model.Simulation.Simulator.Scheduler.Time;
	AssignmentConnector.FulfilledTasks++;
	tr.Created();
}

// create result
Job job = Worker.newJob;

JobResult jr = Worker.CrowdSourcing.Create("JobResult") as JobResult;
jr.JobRef = job; 
jr.resultId = job.jobId+"Result";

if (Model.Simulation.Simulator.Random < Worker.SkillFit)
	jr.quality = 1.0;
else
	jr.quality = 0.0;

Worker.ResultCounter++;

// finally:
Worker.newJob = null;
jr.Created();

// add Worker to WaitingWorkerQueue on AssignmentConnector
Worker.CrowdSourcing.AssignmentConnectorList[0].WaitingWorkerQueue.Enqueue(Worker);

Worker.CrowdSourcing.AssignmentConnectorList[0].WaitingWorkerQueueSize++;

var AssignmentConnector = SimpleConnectorBehavior.CrowdSourcing.AssignmentConnectorList[0];

while (AssignmentConnector.TaskQueue.Count > 0)
{
	Task task = AssignmentConnector.TaskQueue.Dequeue();	
	task.DispatchedJobs = SimpleConnectorBehavior.taskCopies;

	for (int i = 0; i < SimpleConnectorBehavior.taskCopies; i++)
	{
		Job j = AssignmentConnector.CrowdSourcing.Create("Job") as Job;
		j.TaskRef = task; 
		j.jobId = task.taskId + "#" + i;
		AssignmentConnector.JobQueueSize++;	
		AssignmentConnector.JobQueue.Enqueue(j);	
	}	
}

var AssignmentConnector = SimpleConnectorBehavior.CrowdSourcing.AssignmentConnectorList[0];

var d = AssignmentConnector.TaskResultDict;
while (AssignmentConnector.ResultQueue.Count > 0)
{
	JobResult jr = AssignmentConnector.ResultQueue.Dequeue();
	List<JobResult> value;
	if (d.TryGetValue(jr.JobRef.TaskRef, out value))
	{
	   	value.Add(jr);
		if (jr.quality == 1.0)
			jr.JobRef.TaskRef.CountPosJobs++;
		else
			jr.JobRef.TaskRef.CountNegJobs++;
		d[jr.JobRef.TaskRef] = value;

		if (value.Count >= SimpleConnectorBehavior.taskCopies)
		{
			int pos = jr.JobRef.TaskRef.CountPosJobs;
			int neg = jr.JobRef.TaskRef.CountNegJobs;

			TaskResult tr = AssignmentConnector.CrowdSourcing.Create("TaskResult") as TaskResult;			
			tr.TaskRef = jr.JobRef.TaskRef;
			tr.cost = jr.JobRef.TaskRef.DispatchedJobs;
			tr.quality = (double)pos/(double)(pos+neg);			
			AssignmentConnector.TaskResultQueue.Enqueue(tr);
			d.Remove(jr.JobRef.TaskRef);			
		}	
	}	
}

var AssignmentConnector = ProgressiveConnectorBehavior.CrowdSourcing.AssignmentConnectorList[0];

while (AssignmentConnector.TaskQueue.Count > 0)
{
	Task task = AssignmentConnector.TaskQueue.Dequeue();	
	task.DispatchedJobs = ((ProgressiveConnectorBehavior.maxJobCopies+1)/2); 

	for (int i = 0; i < ((ProgressiveConnectorBehavior.maxJobCopies+1)/2); i++)
	{
		Job j = AssignmentConnector.CrowdSourcing.Create("Job") as Job;
		j.TaskRef = task; 
		j.jobId = task.taskId + "#" + i;
		AssignmentConnector.JobQueueSize++;	
		AssignmentConnector.JobQueue.Enqueue(j);	
	}	
}

var AssignmentConnector = ProgressiveConnectorBehavior.CrowdSourcing.AssignmentConnectorList[0];

var d = AssignmentConnector.TaskResultDict;
while (AssignmentConnector.ResultQueue.Count > 0)
{
	JobResult jr = AssignmentConnector.ResultQueue.Dequeue();
	List<JobResult> value;
	if (d.TryGetValue(jr.JobRef.TaskRef, out value))
	{
	   	value.Add(jr);
		if (jr.quality == 1.0)
			jr.JobRef.TaskRef.CountPosJobs++;
		else
			jr.JobRef.TaskRef.CountNegJobs++;
		d[jr.JobRef.TaskRef] = value;

		if (value.Count >= jr.JobRef.TaskRef.DispatchedJobs)
		{
			int pos = jr.JobRef.TaskRef.CountPosJobs;
			int neg = jr.JobRef.TaskRef.CountNegJobs;

			int max = Math.Max(pos, neg);
			if (max >= ((ProgressiveConnectorBehavior.maxJobCopies+1)/2))
			{
				TaskResult tr = AssignmentConnector.CrowdSourcing.Create("TaskResult") as TaskResult;			
				tr.TaskRef = jr.JobRef.TaskRef;
				tr.cost = jr.JobRef.TaskRef.DispatchedJobs;
				tr.quality = (double)pos/(double)(pos+neg);			
				AssignmentConnector.TaskResultQueue.Enqueue(tr);
				d.Remove(jr.JobRef.TaskRef);
			}
			else
			{
				int moreJ = ((ProgressiveConnectorBehavior.maxJobCopies+1)/2)-max;
				for (int i = 0; i < moreJ; i++)
				{
					Job j = AssignmentConnector.CrowdSourcing.Create("Job") as Job;
					j.TaskRef = jr.JobRef.TaskRef; 
					j.jobId = jr.JobRef.TaskRef.taskId + "#" + (i+jr.JobRef.TaskRef.DispatchedJobs);
					AssignmentConnector.JobQueueSize++;	
					AssignmentConnector.JobQueue.Enqueue(j);	
				}	
				jr.JobRef.TaskRef.DispatchedJobs += moreJ;
			}
		}	
	}	
}

var AssignmentConnector = IterativeConnectorBehavior.CrowdSourcing.AssignmentConnectorList[0];

while (AssignmentConnector.TaskQueue.Count > 0)
{
	Task task = AssignmentConnector.TaskQueue.Dequeue();	
	task.DispatchedJobs = IterativeConnectorBehavior.requiredD; 

	for (int i = 0; i < IterativeConnectorBehavior.requiredD ; i++)
	{
		Job j = AssignmentConnector.CrowdSourcing.Create("Job") as Job;
		j.TaskRef = task; 
		j.jobId = task.taskId + "#" + i;
		AssignmentConnector.JobQueueSize++;	
		AssignmentConnector.JobQueue.Enqueue(j);	
	}	
}

var AssignmentConnector = IterativeConnectorBehavior.CrowdSourcing.AssignmentConnectorList[0];

var d = AssignmentConnector.TaskResultDict;
while (AssignmentConnector.ResultQueue.Count > 0)
{
	JobResult jr = AssignmentConnector.ResultQueue.Dequeue();
	List<JobResult> value;
	if (d.TryGetValue(jr.JobRef.TaskRef, out value))
	{
	   	value.Add(jr);
		if (jr.quality == 1.0)
			jr.JobRef.TaskRef.CountPosJobs++;
		else
			jr.JobRef.TaskRef.CountNegJobs++;
		d[jr.JobRef.TaskRef] = value;

		if (value.Count >= jr.JobRef.TaskRef.DispatchedJobs)
		{
			int pos = jr.JobRef.TaskRef.CountPosJobs;
			int neg = jr.JobRef.TaskRef.CountNegJobs;
			int diff = Math.Abs(pos - neg);
			if (diff >= IterativeConnectorBehavior.requiredD )
			{
				TaskResult tr = AssignmentConnector.CrowdSourcing.Create("TaskResult") as TaskResult;			
				tr.TaskRef = jr.JobRef.TaskRef;
				tr.cost = jr.JobRef.TaskRef.DispatchedJobs;
				tr.quality = (double)pos/(double)(pos+neg);			
				AssignmentConnector.TaskResultQueue.Enqueue(tr);
				d.Remove(jr.JobRef.TaskRef);
			}
			else
			{
				int moreJ = IterativeConnectorBehavior.requiredD - diff;
				for (int i = 0; i < moreJ; i++)
				{
					Job j = AssignmentConnector.CrowdSourcing.Create("Job") as Job;
					j.TaskRef = jr.JobRef.TaskRef; 
					j.jobId = jr.JobRef.TaskRef.taskId + "#" + (i+jr.JobRef.TaskRef.DispatchedJobs);
					AssignmentConnector.JobQueueSize++;	
					AssignmentConnector.JobQueue.Enqueue(j);	
				}	
				jr.JobRef.TaskRef.DispatchedJobs += moreJ;
			}
		}	
	}	
}

foreach (CrowdSourcing s in CrowdSourcingList)
{
	int i = 0;
	foreach (Master m in s.MasterList)
	{
		m.MasterId = "Master"+i;
		i++;
	}
	int j = 0;
	foreach (Worker w in s.WorkerList)
	{
		w.WorkerId = "Worker"+j;
		j++;
	}
}
